import React from 'react';

const Whatsapi = () => {
    return (
        <div>
            <div class="fb-post" data-href="https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fpermalink.php%3Fstory_fbid%3Dpfbid0aK47bsyKd8zB15n7NGxVfVbjnXtrRqiwiDv6Aerxq7gsp1UNyr1ba8HnDtvasDWrl%26id%3D100064278240012&show_text=true&width=500" width="500" height="706" style="border:none;overflow:hidden" scrolling="no" frameborder="0" allowfullscreen="true" allow="autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share"></div>

        </div>
    );
}

export default Whatsapi;
